function switchBurger(){if(document.getElementById("navbox-btn")){let a=document.getElementById("navbox-btn"),b=document.getElementById('target');a.addEventListener('click',()=>{a.classList.toggle('open'),b.classList.toggle('hidden')})}}function isInViewport(a){const b=a.getBoundingClientRect();return b.top<(window.innerHeight||document.documentElement.clientHeight)}function showPic(){setTimeout(function(){for(var b=document.getElementsByClassName('imag'),a=0;a<b.length;a++)isInViewport(b[a])&&b[a].getAttribute("data-toset")&&(b[a].src=b[a].dataset.toset,delete b[a].dataset.toset)},100)}showPic()